import React,{useState,useEffect} from "react";
import './AHome.css';
import axios from "axios";
import Select from "react-select";
import {Link,useNavigate} from 'react-router-dom';

function AHome(){
    const [cdata,setcdata]=useState([]);
    const [vchecker,setchecker]=useState(false);
    const [vchecker1,setchecker1]=useState(false);
    const [center_name,set_center_name]=useState('');
    const [center_name1,set_center_name1]=useState('');
    const [center_location,set_center_location]=useState('');
    const [center_mobile,set_mobile]=useState('');
    const [center_dosage,set_dosage]=useState(0);
    const [center_dosage1,set_dosage1]=useState(0);
    const navigate=useNavigate()
    useEffect(()=>{
        axios.get('http://localhost:3001/acentersee').then((response)=>{
          if(response.data==="no"){
            setchecker1(true);
          }
          else{
          setcdata(response.data);
          setchecker(true);
          }
        });

        })
        const myinsert=()=>{
            axios.post('http://localhost:3001/acenterins',{
                cname:center_name,
                location:center_location,
                mobile:center_mobile,
                dosage:center_dosage,
                dosage1:center_dosage1
            }).then((response)=>{
                if(response.data==="no"){
                    alert('Vaccination Center already exists');    
                }
                else{
                alert('Vaccination Center created/updated successfully');
                window.location.reload();
                navigate('/admin/home')

            }
            })
        }
        const mydelete=()=>{
            axios.post('http://localhost:3001/acenterdel',{
                cname:center_name1
            }).then((response)=>{
                if(response.data==="no"){
                    alert('Error Occurred');    
                }
                else{
                alert('Vaccination Center deleted successfully');
                window.location.reload();
                navigate('/admin/home')
            }
            })
        }
        const options = cdata.map((data) => ({
            value: data.center_name,
            label: data.center_name,
          }));

    return(
        <div className="ahome">
            <h1>Vaccination Centers Chart</h1>

            <div className="admin-buttons">
                <input type="text" style={{marginRight:'3px'}} placeholder="Search here"/>
                <button><i style={{marginRight:'3px'}}class="fa-solid fa-plus"></i><a href="#popup">Add</a></button>
            </div>

            <div id="popup" class="overlay">
                <div class="popup">
                  <h2>CREATE VACCINATION CENTER</h2>
                  <a class="close" href="#">&times;</a>

                  <form onSubmit={myinsert}>
                    <div className="mydivs">
                        <label>Center Name</label>
                        <input type="text" placeholder="Enter center name" value={center_name} onChange={(e)=>{set_center_name(e.target.value);}}/>

                        <label>Center Location</label>
                        <input type="text" placeholder="Enter center location" value={center_location} onChange={(e)=>{set_center_location(e.target.value);}}/>

                        <label>Mobile Number</label>
                        <input type="tel" placeholder="Enter Contact Number" value={center_mobile} onChange={(e)=>{set_mobile(e.target.value);}}/>

                        <label>Covishield Availability</label>
                        <input type="number" placeholder="Enter dosage count" value={center_dosage} onChange={(e)=>{set_dosage(e.target.value);}}/>

                        <label>Covaxin Availability</label>
                        <input type="number" placeholder="Enter dosage count" value={center_dosage1} onChange={(e)=>{set_dosage1(e.target.value);}}/>
                        <button type="submit">Submit</button>
                    </div>
                  </form>
                </div>
              </div>

              <div id="popup1" class="overlay">
                <div class="popup">
                  <h2>DELETE VACCINATION CENTER</h2>
                  <a class="close" href="#">&times;</a>
                    <h5>Note: Select the Center name to be deleted from the select box given below</h5>
                  <form onSubmit={mydelete}>
                    <div className="mydivs">
                        <label>Select Center Name</label>
                        <Select options={options} placeholder="Select Center Name" value={center_name1} onChange={handleSelectChange}/>
                        <button type="submit">Submit</button>
                    </div>
                  </form>
                </div>
              </div>

            <div className="list-table">
            <table  class="table table-striped table-bordered table-sm" cellspacing="0" width="100%">
            <thead>
    <tr>
      <th class="th-sm">Centre Name
      </th>
      <th class="th-sm">Centre Location
      </th>
      <th class="th-sm">Date added
      </th>
      <th class="th-sm">Mobile Number
      </th>
      <th class="th-sm">Covishield Availability
      </th>
      <th class="th-sm">Covaxin Availability
      </th>
      <th class="th-sm">Edit/Remove</th>
    </tr>
  </thead>
  <tbody>
    {
    vchecker&&cdata.map((data)=>{
        return(
          <tr>
            <td>{data.center_name}</td>
            <td>{data.location}</td>
            <td>{data.date_added}</td>
            <td>{data.mobile}</td>
            <td>{data.dosage}</td>
            <td>{data.covaxine}</td>
            <td>
              <button className="edit-now" onClick={()=> {
                set_center_name(data.center_name)
                set_center_location(data.location)
                set_mobile(data.mobile)
                set_dosage(data.dosage)
                set_dosage1(data.covaxine)
                }}><a style={{textDecoration:'none',fontSize:'16px',color:'white'}} href="#popup"><i style={{marginRight:'3px'}} class="fa-solid fa-pen"></i></a></button>
              <button className="remove-now" onClick={()=> {
                set_center_name1(data.center_name)

                }}><a style={{textDecoration:'none',fontSize:'16px',color:'white'}} href="#popup1"><i style={{marginRight:'3px'}} class="fa-solid fa-trash"></i></a></button>
            </td>
          </tr>
        );
    })
    }
    {vchecker1&&<tr><td colSpan={7}>No data found</td></tr>}
    </tbody>
            </table>
            </div>
        </div>
    )
}
export default AHome;
